import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <div>
        <img src={require("../IMG-5355.jpg")} alt="" class="img-thumbnail" />
        <p>A.C.K St.Peter's Church, Kahawa Sukari</p>
      </div>
    );
  }
}

export default Header;
